<aside class="chosenData plain">
  <ul class="labels">
    <li class="origin">Origin:</li>
    <li class="destination">Destinaion:</li>
    <li class="adults">Adults:</li>
    <li class="infants" *ngIf="infants">Infants:</li>
    <li class="children" *ngIf="children">Children:</li>
    <li class="selectedSeats" *ngIf="selectedSeats">Selected seats:</li>
  </ul>
  <ul class="data">
    <li class="originData">{{ origin }}</li>
    <li class="destinationData">{{ destination }}</li>
    <li class="adultsData">{{ adults }}</li>
    <li class="infantsData" *ngIf="infants">{{ infants }}</li>
    <li class="childrenData" *ngIf="children">{{ children }}</li>
    <li class="selectedSeatsData" *ngIf="selectedSeats">{{ seats }}</li>
  </ul>
  <button
    class="btn"
    routerLink="/confirmation"
    type="submit"
    (click)="onSubmit()"
  >
    Submit
  </button>
</aside>
